import React from 'react';
import {NavLink} from 'react-router-dom';

const Navbar = () => {
    return (
        <nav className="nav-wrapper indigo darken-4">
            <ul>
                <li><NavLink to="/" className="brand-logo">To-Do List</NavLink></li>
                <li><NavLink className="right" to="/create">New To-Do</NavLink></li>
            </ul>
        </nav>
    )
}
export default Navbar;
